import React from 'react';
import logo from './logo.svg';
import './App.css';

class MyNavbar extends React.Component{
  render() {
      return (
         <Navbar>
          <Navbar.Header>
            <Navbar.Brand>
              <a href="#home">My Brand</a>
            </Navbar.Brand>
          </Navbar.Header>
          <Nav>
            <NavItem href="#">
              Home
            </NavItem>
            <NavItem href="#">
              About
            </NavItem>
            <NavItem href="#">
              FAQ
            </NavItem>
            <NavItem href="#">
              Contact Us
            </NavItem>
          </Nav>
        </Navbar>
      );
  }
}

export default App;
